window.addEventListener("load",function(){document.getElementById("btn").onclick=function(){let e=document.getElementById("text").value.split("\n"),t=[];for(let n=0;n<=e.length;n++)if(void 0!==e[n]){let o=document.createElement("a");o.href=e[n],console.log(o.hostname),"file:"!==o.protocol&&t.push(o.protocol+"//"+o.hostname)}document.getElementById("result").value=t.join("\n")}});